axios.post("http://localhost:5000/login",{email,password})
.then(res=>{
 if(res.data.message==="success"){
   localStorage.setItem("userToken",res.data.token);
   alert("Login success");
   window.location="/rooms";
 } else alert("Login Failed");
});
